import React from 'react';
import HomePortfolio from 'src/componentes/Portfolio/HomePortfolio/HomePortfolio';
import SobreMim from 'src/componentes/Portfolio/SobreMim/SobreMim';
import CompetenciaPortfolio from 'src/componentes/Portfolio/CompetenciaPortfolio/CompetenciaPortfolio';
import ProjetosPortfolio from 'src/componentes/Portfolio/ProjetosPortfolio/ProjetosPortfolio';
import ContatoPortfolio from 'src/componentes/Portfolio/ContatoPortfolio/ContatoPortfolio';

function PaginaPortfolio() {
    return (
        <div>
            <HomePortfolio />
            <SobreMim />
            <CompetenciaPortfolio />
            <ProjetosPortfolio />
            <ContatoPortfolio />
        </div>
    );
}

export default PaginaPortfolio;
